  false,\n\t\"url\": null,\n\t\"notes\": \"These data are stacked multichannel marine
  seismic reflection data recorded during 1987-88 in the Antarctica Peninsula region,
  by Petrobras, Brazil. The following data types are included for each line: computer
  display images, location maps, and the digital seismic data. Software is provided
  to view the images, to plot selected portions of the data to the screen, and to
  convert the data into SEG-Y format. The CD-ROM was produced in accordance with the
  ISO 9660 Standard. The display software runs only under DOS. All text files are
  in ASCII format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
